'use strict';

var app = new (require('express'))()
  , bodyParser = require('body-parser')
  , superagent = require('superagent')
  , jade = require('jade')
  ;

app.get('/', (req, res) => res.send(contactForm));
app.get('/contact-form.js', (req, res) => res.send(contactFormJs));

var contact_fields = ['name','email','company','message','subject','role'];

/*
  * Creates a contact in intercom (if necessary) and files a ZENDESK ticket. 
  * Requires the following env vars to be set:
  *
  * INTERCOM_PAT to the Intercom PAT
  * ZENDESK_TICKETS_URL to the Zendesk tickets endpoint
  * ZENDESK_USER to the Zendesk username (without /token)
  * ZENDESK_TOKEN to the user token.
*/

var secrets = module.webtask.secrets;

const INTERCOM_USER_URL = secrets.INTERCOM_USER_URL;
const INTERCOM_PAT = secrets.INTERCOM_PAT;
const ZENDESK_TICKETS_URL = secrets.ZENDESK_TICKETS_URL;
const ZENDESK_USER = secrets.ZENDESK_USER;
const ZENDESK_TOKEN = secrets.ZENDESK_TOKEN;
const ZENDESK_GROUP = secrets.ZENDESK_GROUP;
const ZENDESK_SOURCE_ID = secrets.ZENDESK_SOURCE_ID;
const ZENDESK_COMPANY_ID = secrets.ZENDESK_COMPANY_ID;
const ZENDESK_ROLE_ID = secrets.ZENDESK_ROLE_ID;
const ZENDESK_EXTEND_SOURCE_ID = secrets.ZENDESK_EXTEND_SOURCE_ID;

app.post('/',
  bodyParser.urlencoded({ extended: false }),
  function (req, res) {
    console.log('REQUEST', req.body);
    var actual_keys = Object.keys(req.body);
    if (actual_keys.length !== contact_fields.length)
      return res.status(400).end();
    for (var i = 0; i < actual_keys.length; i++) {
      if (contact_fields.indexOf(actual_keys[i]) < 0 || typeof req.body[actual_keys[i]] !== 'string')
        return res.status(400).end();
    }

    function customerUpsert(body, cb) {
      superagent.post(INTERCOM_USER_URL)
        .set('Accept', 'application/json')
        .auth(INTERCOM_PAT, '')
        .send({
          email: body.email,
          name: body.name,
          custom_attributes: {
            company: body.company,
            role: body.role,
            extend: true,
            extend_last_seen_at: new Date(),
          }
        })
        .end(cb);
    } 
    
    function getExtendSource(source) {
      return source.indexOf("support") > -1 ? "extend_support" : "extend_sales"
    }

    function createZendesk(body, query, cb) {
      var util = require('util');
      superagent.post(ZENDESK_TICKETS_URL)
        .set('Accept', 'application/json')
        .auth(ZENDESK_USER + "/token", ZENDESK_TOKEN)
        .send({
          ticket: {
            subject: `Source [Auth0 Extend]: ${ query.source || 'contact_form' } ${body.subject}`,
            ticket_form_id: 622708,
            group_id: ZENDESK_GROUP,
            description: body.message,
            requester: {
              name: body.name + "/token",
              email: body.email
            },
            tags: ["extend_contact", 'extend_' + (query.source || 'contact_form')],
            custom_fields: [
                {
                    "id": ZENDESK_SOURCE_ID,
                    "value": 'extend_' + (query.source || 'contact_form')
                },
                {
                    "id":ZENDESK_COMPANY_ID,
                    "value": body.company
                },
                {
                    "id":ZENDESK_ROLE_ID,
                    "value": body.role
                },
                {
                    "id":ZENDESK_EXTEND_SOURCE_ID,
                    "value" : getExtendSource(query.source)
                }
            ]
          }
        })
        .end(cb);
    }
    
    customerUpsert(req.body, (err1,res1) => {
      if (err1 === null) {
        console.log('INTERCOM RESPONSE', err1, res1 && res1.statusCode, res1 && res1.body);
      }
      createZendesk(req.body, req.query, (err2,res2) => {
        console.log('ZENDESK RESPONSE', err2, res2 && res2.statusCode, res2 && res2.body);
        if (err2) {
          console.error(err2);
          return res.status(500).json({ error: err2.message || err2.toString() });
        }
        return res.status(res2.statusCode).end();
      });
    });
    
    var util = require('util');
    console.log("query", util.inspect(req.query));
  }
);

module.exports = app;

